import React from "react";
import axios from "axios";
import "./Button.css";

export default function Button() {
  function handleResponse(response) {
    console.log(response.data);
  }
  const apiKey = "19f46cb6a372e938ec33a12b4f819dec";
  let city = "New York";
  let apiUrl =`http://api.openweathermap.org/data/2.5/weather?q=${city}&appid=${apiKey}`;
  axios.get(apiUrl).then(handleResponse);
  return (
    <div className="Button">
      <div className="form-group">
        <form>
          <input type="text" placeholder="Enter a city " className="city" />
          <input
            type="submit"
            value="Search"
            className="submitButton"
            autocomplete="off"
          />
          <input type="submit"  value="Current" className="current"/>
        </form>
      </div>
    </div>
  );
}
